(386, 385, 'Don’t leave this up to your wife. The day of the date, clean the house and have written instructions for the sitter. Do it all so she feels totally free of responsibility', 'Don’t leave this up to your wife. The day of the date, clean the house and have written instructions for the sitter. Do it all so she feels totally free of responsibility', 6, 0, 0, '2020-02-24 02:51:16', '2020-02-24 02:51:16'),
