(388, 387, 'Check availability and make reservations in advance. Make sure what you plan to do will be available and confirm the day before', 'Check availability and make reservations in advance. Make sure what you plan to do will be available and confirm the day before', 6, 0, 0, '2020-02-24 02:51:35', '2020-02-24 02:51:35'),
