(391, 0, 'Make sure everything looks good', 'null', 6, 0, 0, '2020-02-24 02:52:03', '2020-02-24 02:52:03'),
(392, 391, 'Detail the car. Get a haircut and wear your best outfit. Shower, shave, put on the cologne she loves.', 'Detail the car. Get a haircut and wear your best outfit. Shower, shave, put on the cologne she loves.', 6, 0, 0, '2020-02-24 02:52:18', '2020-02-24 02:52:18'),
