(398, 396, 'Schedule events and activities that require advance registration or booking', 'Schedule events and activities that require advance registration or booking', 21, 0, 0, '2020-02-24 02:57:03', '2020-02-24 02:57:03'),
(399, 396, 'Make contact with family members by email to keep them up to date on family reunion plans. Encourage email contacts to help spread the word.', 'Make contact with family members by email to keep them up to date on family\r\nreunion plans. Encourage email contacts to help spread the word.', 21, 0, 0, '2020-02-24 02:57:11', '2020-02-24 02:57:11'),
(400, 0, '6 Months Prior', 'null', 21, 0, 0, '2020-02-24 02:57:18', '2020-02-24 02:57:18'),
(401, 0, 'Three to six months before the party', 'null', 22, 0, 0, '2020-02-24 03:01:19', '2020-02-24 03:01:19'),
(402, 401, 'Save Set up an account at your bank specifically for saving funds towards the party, and add a little each week. Ask other family members to chip in', 'Save Set up an account at your bank specifically for saving funds towards the party, and add a little each week. Ask other family members to chip in', 22, 0, 0, '2020-02-24 03:01:35', '2020-02-24 03:01:35'),
(403, 401, 'Make a guest list This is subject to flux, but get a ballpark idea of how many guests you can handle.', 'Make a guest list This is subject to flux, but get a ballpark idea of how many guests you can handle.', 22, 0, 0, '2020-02-24 03:01:46', '2020-02-24 03:01:46'),
(404, 401, 'Choose a venue June is wedding month as well as graduation, so book early and put down a deposit. Or, plan to have the party at your house, or a classmate\'s home.', 'Choose a venue June is wedding month as well as graduation, so book early and put down a deposit. Or, plan to have the party at your house, or a classmate\'s home.', 22, 0, 0, '2020-02-24 03:01:56', '2020-02-24 03:01:56'),
(405, 401, 'Network Planning way in advance can discourage wild off-site parties being planned by the graduates themselves. Work with other parents to plan an all inclusive party for a safe, fun time.', 'Network Planning way in advance can discourage wild off-site parties being planned by the graduates themselves. Work with other parents to plan an all inclusive party for a safe, fun time.', 22, 0, 0, '2020-02-24 03:02:04', '2020-02-24 03:02:04'),
(406, 0, 'Six to eight weeks before the party', 'null', 22, 0, 0, '2020-02-24 03:02:12', '2020-02-24 03:02:12'),
(407, 406, 'Budget By now you should have save some cash and have an idea of what you can spend. Lay out a realistic game plan.', 'Budget By now you should have save some cash and have an idea of what you can spend. Lay out a realistic game plan.', 22, 0, 0, '2020-02-24 03:02:24', '2020-02-24 03:02:24'),
(408, 406, ' Supplies Graduation party supplies can sell out fast, so get some of the paper products and decorations early - they won\'t spoil.', ' Supplies Graduation party supplies can sell out fast, so get some of the paper products and decorations early - they won\'t spoil.', 22, 0, 0, '2020-02-24 03:02:34', '2020-02-24 03:02:34'),
(409, 406, ' Liquor If you are holding your college graduation party in a banquet hall you may need to obtain licensing, and find a vendor well in advance', ' Liquor If you are holding your college graduation party in a banquet hall you may need to obtain licensing, and find a vendor well in advance', 22, 0, 0, '2020-02-24 03:02:42', '2020-02-24 03:02:42'),
(410, 406, ' Entertainment Maybe one of the graduates is part of a band, or you can convince a local DJ to provide musical entertainment', ' Entertainment Maybe one of the graduates is part of a band, or you can convince a local DJ to provide musical entertainment', 22, 0, 0, '2020-02-24 03:02:54', '2020-02-24 03:02:54'),
(411, 406, ' Catering Another item that should be taken care of sooner rather than later, as spring schedules fill up fast', ' Catering Another item that should be taken care of sooner rather than later, as spring schedules fill up fast', 22, 0, 0, '2020-02-24 03:03:02', '2020-02-24 03:03:02'),
(412, 0, 'Two to four weeks before the party', 'null', 22, 0, 0, '2020-02-24 03:03:11', '2020-02-24 03:03:49'),
(413, 412, ' Invitations Send these out in plenty of time to make sure your party is the one people decide to go to. Ask for RSVPs - include your phone number and email address', ' Invitations Send these out in plenty of time to make sure your party is the one people decide to go to. Ask for RSVPs - include your phone number and email address', 22, 0, 0, '2020-02-24 03:04:33', '2020-02-24 03:04:33'),
(414, 412, 'Dress code Decide if your party is formal and elegant or casual and laid back. Include this information I the invitations', 'Dress code Decide if your party is formal and elegant or casual and laid back. Include this information I the invitations', 22, 0, 0, '2020-02-24 03:04:54', '2020-02-24 03:04:54'),
(415, 412, ' Games Plan some fun games to break the ice and get the party started', ' Games Plan some fun games to break the ice and get the party started', 22, 0, 0, '2020-02-24 03:05:05', '2020-02-24 03:05:05'),
(416, 412, 'Karaoke. Put a deposit down on a machine and sound system early for maximum fun', 'Karaoke. Put a deposit down on a machine and sound system early for maximum fun', 22, 0, 0, '2020-02-24 03:05:15', '2020-02-24 03:05:15'),
(417, 412, 'Seating Make sure you have plenty of folding chairs even if you are having a casual event', 'Seating Make sure you have plenty of folding chairs even if you are having a casual event', 22, 0, 0, '2020-02-24 03:05:27', '2020-02-24 03:05:27'),
(418, 412, ' Dishes/cutlery/linensIf the caterer isn\'t providing plates, silverware, napkins and tablecloths, make sure you have this covered on your end', ' Dishes/cutlery/linensIf the caterer isn\'t providing plates, silverware, napkins and tablecloths, make sure you have this covered on your end', 22, 0, 0, '2020-02-24 03:05:44', '2020-02-24 03:05:44'),
(419, 0, 'Two to three days before the party', 'null', 22, 0, 0, '2020-02-24 03:05:50', '2020-02-24 03:06:35'),
(420, 419, ' Cake Get your cake ordered and set a time to pick it up - this avoids delivery problems', ' Cake Get your cake ordered and set a time to pick it up - this avoids delivery problems', 22, 0, 0, '2020-02-24 03:06:13', '2020-02-24 03:06:13'),
(421, 419, ' Extras Make a list of what the caterer is covering, and fill in any gaps', ' Extras Make a list of what the caterer is covering, and fill in any gaps', 22, 0, 0, '2020-02-24 03:06:54', '2020-02-24 03:06:54'),
(422, 419, 'Deliveries To avoid late deliveries and delays, accept as many deliveries as you can prior to the actual day of the party', 'Deliveries To avoid late deliveries and delays, accept as many deliveries as you can prior to the actual day of the party', 22, 0, 0, '2020-02-24 03:07:13', '2020-02-24 03:07:13'),
(423, 419, 'Flowers No party is complete without them, so order early and arrange to pick them up the day of the party', 'Flowers No party is complete without them, so order early and arrange to pick them up the day of the party', 22, 0, 0, '2020-02-24 03:07:24', '2020-02-24 03:07:24'),
(424, 0, 'Day of the party', 'null', 22, 0, 0, '2020-02-24 03:07:32', '2020-02-24 03:07:32'),
(425, 424, ' Relax. Get some extra rest in the morning - the party will be exhaustingly fun!', ' Relax. Get some extra rest in the morning - the party will be exhaustingly fun!', 22, 0, 0, '2020-02-24 03:07:43', '2020-02-24 03:07:43'),
(426, 424, 'Memories  Have batteries in cameras and video cams, and a blank book for all guests to sign and later transform into a scrapbook', 'Memories  Have batteries in cameras and video cams, and a blank book for all guests to sign and later transform into a scrapbook', 22, 0, 0, '2020-02-24 03:07:51', '2020-02-24 03:07:51'),
