(6, 'You have an order : {orderID}', 'Order Status for Vendor', '<p>Hello {name},</p>\r\n\r\n<p>The order is placed successfully&nbsp;</p>\r\n\r\n<p>{OrderDetail}</p>', '2019-12-31 07:11:00', '2019-12-31 07:12:15'),
(7, 'Your Account has been approved', 'Vendor Approval', '<p>Hello {name}</p>\r\n\r\n<p>Your Account has been approved</p>', '2020-01-02 08:54:48', '2020-01-02 08:56:04'),
(8, 'Your Account has been rejected.', 'Reject Approval', '<p>Hello {name}</p>\r\n\r\n<p>Your Account has been rejected due to some reason which is given below:</p>\r\n\r\n<p>{detail}&nbsp;</p>\r\n\r\n<p>Please Correct your detail according to rejection : {link}</p>', '2020-01-02 08:55:01', '2020-01-09 03:15:58'),
(9, 'We have reference to inviting you at our Website', 'Inviting Vendor', '<p>Hello {name}</p>\r\n\r\n<p>We have reference to inviting you to our Website.&nbsp;<strong>{business}</strong></p>\r\n\r\n<p>Please join&nbsp;our membership&nbsp;to grow up your business.</p>', '2020-01-03 00:45:15', '2020-01-09 02:46:41'),
(10, 'Resubmit account for approval', 'Vendor Account Resubmit for Approval', '<div style="page-break-after: always"><span style="display: none;">&nbsp;</span></div>\r\n\r\n<hr />\r\n<ul>\r\n	<li>\r\n	<p><span dir="ltr" lang="fr"><span style="font-family:Verdana,Geneva,sans-serif;">Hello Admin {name} has been updated the account information according to your message. </span></span></p>\r\n	</li>\r\n	<li>}Please check from</li>\r\n</ul>', '2020-01-09 05:12:17', '2021-07-26 07:19:34'),
(11, 'New Vendor Joining', 'New Vendor', '<p>Hello Admin</p>\r\n\r\n<p>{name} is joined as A vendor account.</p>\r\n\r\n<p>Please check from this link: {link}</p>', '2020-01-09 05:58:03', '2020-01-09 06:00:37'),
(12, 'Pricing Quote Request', 'Pricing Quote Request', '<p>Hello {name},</p>\r\n\r\n<p>{username} is requested for Pricing Quote:</p>\r\n\r\n<p>{message}</p>', '2020-01-13 01:50:25', '2020-01-13 01:53:16'),
(13, 'Request For Custom Package', 'Request For Custom Package', '<p>Hello {name}</p>\r\n\r\n<p>You have a request for create custom package by {username} :</p>\r\n\r\n<p>{message}</p>\r\n\r\n<p>&nbsp;</p>', '2020-01-13 01:50:44', '2020-01-13 04:08:04'),
(14, 'Order Placed', 'Order Placed', '<p>Hello {name}</p>\r\n\r\n<p>Your order have been placed successfully.</p>\r\n\r\n<p>{OrderDetail}&nbsp;</p>', '2020-02-04 02:42:52', '2021-07-28 07:32:47'),
(15, 'You have an new Order.', 'New Order For Vendor', '<p>Hello {name}</p>\r\n\r\n<p>You have an new Order</p>\r\n\r\n<p>{OrderDetail}</p>', '2020-02-04 05:30:50', '2020-02-04 05:33:02'),
(16, 'Your Business is blocked', 'Block The Vendor', '<p>Hello {name}</p>\r\n\r\n<p>your business ({businesName}) is blocked.</p>\r\n\r\n<p>Thanks</p>', '2020-02-12 08:39:16', '2020-02-12 08:40:45'),
(17, 'Inviting', 'Invite User', '<p>Hello {name}</p>\r\n\r\n<p>We have reference to inviting you to our Website.&nbsp;<b>&nbsp;</b></p>\r\n\r\n<p>Please join&nbsp;with us and find vendors.</p>', '2020-02-13 02:26:25', '2020-02-13 02:27:50'),
(18, 'Your Shop has been rejected.', 'Shop Rejected', '<p>Hello {name},</p>\r\n\r\n<p>Your shop {shopName} is rejected to due some reasons which are given below:</p>\r\n\r\n<p>{reasons}</p>', '2020-02-17 06:35:18', '2020-02-17 06:36:48'),
(19, 'Product Rejection', 'Product Rejection', '<p>Hello {name},</p>\r\n\r\n<p>The Product has been rejected by Admin due to some reasons:</p>\r\n\r\n<p>Shop Name : {shopName},</p>\r\n\r\n<p>Product Name : {productName)</p>\r\n\r\n<p>Reasons are:</p>\r\n\r\n<p>{reasons}</p>', '2020-02-17 06:37:07', '2020-02-17 06:48:56'),
(20, 'Your Shop is Approved', 'Shop Approved', '<p>Hello {name}</p>\r\n\r\n<p>Your Shop ({shopName}) is approved now.</p>', '2020-02-17 08:55:52', '2020-02-17 09:13:57'),
(21, 'Product is Approved', 'Product Approved', '<p>Hello {name},</p>\r\n\r\n<p>The Product has been approved by Admin.</p>\r\n\r\n<p>Shop Name : {shopName},</p>\r\n\r\n<p>Product Name : {productName)</p>', '2020-02-18 02:48:03', '2020-02-18 02:49:16'),
(22, NULL, 'Disppute', '', '2020-04-16 15:44:04', '2020-04-16 15:44:04'),
(23, 'Invitation', 'Invite Guest', '<p>Hello {name},</p>\r\n\r\n<p>Event Location: {event_location}</p>\r\n\r\n<p>This is a test.</p>\r\n\r\n<p><a href="{accept_url}" style=" background: #04a9f5; color: #fff; font-size: 16px; padding: 10px 16px; text-decoration: none; border-radius: 4px;">Accept</a>&nbsp;<a href="{decline_url}" style="background: #04a9f5; color: #fff;   font-size: 16px;  padding: 10px 16px; text-decoration: none;    border-radius: 4px;">Decline</a></p>\r\n\r\n<p>Thanks</p>', '2020-10-23 04:04:26', '2020-10-27 07:04:12'),
(24, 'User Event', 'Share User Event', '<p>Hello Test,</p>\r\n\r\n<p>We are sharing the details of the User Event. Kindly click on the following URL to see to Event Details.</p>\r\n\r\n<p><a href="{detail_url}" style=" background: #04a9f5; color: #fff; font-size: 16px; padding: 10px 16px; text-decoration: none; border-radius: 4px;">View Details</a></p>\r\n\r\n<p>Thanks&nbsp;</p>', '2021-01-13 06:11:11', '2021-01-13 07:57:35'),
(25, 'Thank You Note', 'Guest Thank You Note', '<p>Hello {name},</p>\r\n\r\n<p>We thank you to attend the {event_name}.</p>\r\n\r\n<p>{note}</p>\r\n\r\n<p>Thanks</p>', '2021-01-20 03:25:54', '2021-01-20 04:00:21'),
(26, 'Review Request', 'Review Request', '<p>Hello {name},</p>\r\n\r\n<p>We thank you to hiring us on your&nbsp;event named {event_name}.</p>\r\n\r\n<p>You can review using following URL:</p>\r\n\r\n<p>{review_url}</p>\r\n\r\n<p>Thanks</p>', '2021-03-12 11:55:54', '2021-03-15 09:42:31'),
(27, 'User\'s Event Information', 'Event Information Sharing', '<p>Hello {vendor_name},</p>\r\n\r\n<p>We would like to inform you that we have some event information that you might be interested in.</p>\r\n\r\n<p>Event Details:</p>\r\n\r\n<p>Event Name:&nbsp;{event_name}</p>\r\n\r\n<p>Event Location:&nbsp;{event_location}</p>\r\n\r\n<p>User Name:&nbsp;{user_name}</p>\r\n\r\n<p>User Email:&nbsp;{user_email}</p>\r\n\r\n<p>Thanks</p>', '2021-03-16 06:52:30', '2021-03-16 07:25:57'),
(28, 'Invitation', 'Invite Cohost', '<p>Hello {name},</p>\r\n\r\n<p>I would like you to be the co-host on the event named &quot;{event_name}&quot;&nbsp;&nbsp;</p>\r\n\r\n<p>Event Location: {event_location}<br />\r\n<br />\r\nTo be the co-host on the event kindly follow the steps given below:</p>\r\n\r\n<p>If you are not a member of eplame:<br />\r\n<br />\r\n1. Kindly register using the following URL using the&nbsp;email on which you are recieving this notification using the following URL: {register_url}</p>\r\n\r\n<p>2. Verify your email and login into the website.</p>\r\n\r\n<p>3. Just click the &quot;Accept&quot; button given below and that&#39;s it.</p>\r\n\r\n<p>If you are already&nbsp;a member of eplame:<br />\r\n<br />\r\n1.Login using the following URL: {login_url}&nbsp;and click on the &quot;Accept&quot; button given below.</p>\r\n\r\n<p><a href="{accept_url}" style=" background: #04a9f5; color: #fff; font-size: 16px; padding: 10px 16px; text-decoration: none; border-radius: 4px;">Accept</a></p>\r\n\r\n<p>Thanks</p>', '2021-05-18 05:42:23', '2021-05-24 05:24:02'),
(29, 'Feedback', 'Feedback', '<p>Hello Admin,</p>\r\n\r\n<p>We have got the following feedback from {name} having an email address {email}</p>\r\n\r\n<p>{description}</p>\r\n\r\n<p>Thanks</p>', '2021-05-31 09:54:35', '2021-06-02 09:14:26'),
(30, 'Report a Bug', 'Bug Report', '<p>Hello Admin,</p>\r\n\r\n<p>{name} having an email address {email}&nbsp;has reported a bug on the website.</p>\r\n\r\n<p>Bug Description:</p>\r\n\r\n<p>{description}</p>\r\n\r\n<p>Thanks</p>', '2021-05-31 09:54:57', '2021-06-02 09:15:38'),
(31, 'Request a Feature', 'Request a Feature', '<p>Hello Admin,</p>\r\n\r\n<p>{name} having an email address {email}&nbsp;has requested for&nbsp;a feature on the website.</p>\r\n\r\n<p>Feature&nbsp;Description:</p>\r\n\r\n<p>{description}</p>\r\n\r\n<p>Any Solution:</p>\r\n\r\n<p>{solution}</p>\r\n\r\n<p>Any Compititor:</p>\r\n\r\n<p>{compition_summary}</p>\r\n\r\n<p>Thanks</p>', '2021-06-08 11:54:51', '2021-06-08 12:06:32'),
(32, 'Sub Admin Registration', 'Sub Admin Registration', '<p>Hello {name},</p>\r\n\r\n<p>Greetings!!</p>\r\n\r\n<p>Admin has created an account for you to be the sub-admin of the website.</p>\r\n\r\n<p>Your login details are as follows:</p>\r\n\r\n<p>Username: {email}</p>\r\n\r\n<p>You can create your password by clicking on forgot password and reset the password.<br />\r\n<br />\r\nThanks</p>', '2021-06-16 06:26:51', '2021-06-16 06:32:50'),
(33, 'Signup Coupon Code', 'Signup Coupon', '<p>Hello {name},</p>\r\n\r\n<p>Thank you for Signup to Site.</p>\r\n\r\n<p>We are providing to you Signup Coupon Code {deal_code}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks</p>', '2021-06-24 09:19:32', '2021-06-24 09:42:34'),
(34, 'Contact form', 'Contact', '<p>Hi Admin,</p>\r\n\r\n<p>{message}</p>\r\n\r\n<p>Please find the contact detail.</p>\r\n\r\n<p>Name - {name}</p>\r\n\r\n<p>Phone number- {phone}</p>\r\n\r\n<p>Email - {email}</p>\r\n\r\n<p>Thank you</p>', '2021-07-01 05:50:19', '2021-07-09 09:41:23'),
(35, 'User Dispute', 'User Dispute', '<p>Hello {name},</p>\r\n\r\n<p>Ticket Id - {ticket_id}</p>\r\n\r\n<p>Event name - {event}</p>\r\n\r\n<p>{reason}</p>\r\n\r\n<p>Please Find the user detials</p>\r\n\r\n<p>User name- {username}</p>\r\n\r\n<p>Email - {email}</p>\r\n\r\n<p>Phone- {phone}</p>\r\n\r\n<p>Thanks</p>', '2021-07-12 06:10:00', '2021-07-12 09:03:54'),
(36, 'User Dispute', 'User Dispute Admin', '<p>Hello Admin,</p>\r\n\r\n<p>Ticket Id - {ticket_id}</p>\r\n\r\n<p>Event name - {event}</p>\r\n\r\n<p>{reason}</p>\r\n\r\n<p>Please Find the user detials</p>\r\n\r\n<p>User name- {username}</p>\r\n\r\n<p>Email - {email}</p>\r\n\r\n<p>Phone- {phone}</p>\r\n\r\n<p>Thanks</p>', '2021-07-12 08:42:07', '2021-07-16 11:57:32'),
(37, 'Request to involve in dispute', 'Admin Involved in Dispute', '<p>Hi Admin,</p>\r\n\r\n<p>Ticket Id - {ticket_id}</p>\r\n\r\n<p>{name} request to involve to&nbsp;&nbsp;solve the dispute.</p>\r\n\r\n<p>Please click on the link to see the dispute - {url}</p>\r\n\r\n<p>Thanks</p>', '2021-07-14 07:02:57', '2021-07-14 08:16:32'),
(38, 'Agreed with Vendor Amount', 'Amount Agreed Mail to Admin', '<p>Hi Admin,</p>\r\n\r\n<p>Ticket Id - {ticket_id}</p>\r\n\r\n<p>{name} agreed with the vendor amount.</p>\r\n\r\n<p>Thanks</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>', '2021-07-26 04:33:53', '2021-07-26 07:13:23'),
(39, 'Reschedule Event', 'Reschedule Email To Vendor', '<p>Hi {name},</p>\r\n\r\n<p>Event Name - {event_name}</p>\r\n\r\n<p>The user requesting for rescheduling the event.</p>\r\n\r\n<p>Reschedule dates: Start date {start_date} and End date {end_date}</p>\r\n\r\n<p>Thanks</p>', '2021-08-18 06:45:45', '2021-08-19 08:16:50'),
(40, 'Vendor Agreed for Reschedule the event', 'Vendor Agree for Reschedule', '<p>Hi {name},</p>\r\n\r\n<p>Event Name - {event_name}</p>\r\n\r\n<p>{vendor_name} is agreed for Reschedule the event.</p>\r\n\r\n<p>Thanks</p>', '2021-08-20 05:51:34', '2021-08-20 05:54:31'),
(41, 'The event has been Rescheduled', 'User Reschedule Dates', '<p>Hi {name},</p>\r\n\r\n<p>Event Name - {event_name}</p>\r\n\r\n<p>The user has been rescheduled the event.</p>\r\n\r\n<p>Rescheduled dates: Start date {start_date} and End date {end_date}</p>\r\n\r\n<p>Thanks</p>', '2021-08-20 06:51:02', '2021-08-20 06:54:00'),
(42, 'User has canceled the event', 'Cancel Event', '<p>Hi {name},</p>\r\n\r\n<p>Event Name - {event_name}</p>\r\n\r\n<p>The user has&nbsp;canceled the event.</p>\r\n\r\n<p>Thanks</p>', '2021-08-20 08:32:18', '2021-08-20 08:37:27'),
(43, 'Virtual Event', 'Virtual Event', '<p>Hi {name},</p>\r\n\r\n<p>Event has been created successfully.</p>\r\n\r\n<p><a href="{url}" style=" background: #04a9f5; color: #fff; font-size: 16px; padding: 10px 16px; text-decoration: none; border-radius: 4px;">link</a></p>\r\n\r\n<p>Thanks</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2021-09-17 04:47:01', '2021-11-01 09:15:24'),
(44, 'Hybrid Event', 'Hybrid Event', '<p>Hi {name},</p>\r\n\r\n<p>Event has been created successfully.</p>\r\n\r\n<p><a href="{url}" style=" background: #04a9f5; color: #fff; font-size: 16px; padding: 10px 16px; text-decoration: none; border-radius: 4px;">link</a></p>\r\n<p>Thanks</p>', '2021-09-17 09:33:32', '2021-11-01 09:14:56'),
(45, 'Event Invitation for registration', 'Event Invitation', '<p>Hi User,</p>\n\n<p>Event Name- {event_name}</p>\n\n<p>We are sharing the Registration link of Event. Kindly click on the following URL and fill the form.</p>\n\n<p><a href="{link}" style=" background: #04a9f5; color: #fff; font-size: 16px; padding: 10px 16px; text-decoration: none; border-radius: 4px;">View Details</a></p>\n\n<p>Thanks</p>', '2021-09-24 07:14:45', '2021-09-27 11:10:33'),
