(50, 'How can I install/upgrade Dummy Content?', '<p>You can either install Dummy Content by using the core extension manager available in the Joomla! Administrator Control Panel, or by using the powerful&nbsp;<a href="https://regularlabs.com/extensionmanager">Regular Labs Extension Manager</a>.</p>\r\n\r\n<p>Note: When updating Dummy Content, you do not need to uninstall it first. The package will update all the files automatically.</p>\r\n\r\n<p>Keep in mind that when you update to a major new version (or uninstall first), you might lose some configuration settings.</p>', 109, 18, 80, NULL, 1, '2020-10-22 04:30:55', '2020-10-22 04:30:55'),
