(55, 'WHAT IS INCLUDED IN THE VENUE RENTAL FEE?', '<p>The venue rental fee includes furnishings for up to 450 guests including mahogany chivari chairs with ivory cushions and various size tables, access to our Soho Suite and Lexington Lounge starting at 10 a.m., a one-hour rehearsal, a four hour photoshoot (during business hours), custom, dimmable lighting including crystal chandeliers throughout the space, men&rsquo;s and women&rsquo;s restroom attendants, an elevator attendant, a venue manager, the operations support team during your event and before and after janitorial services.&nbsp;</p>', 146, 5, 148, NULL, 1, '2021-03-22 11:51:16', '2021-03-22 11:51:46'),
(56, 'CAN THE SOHO SUITE & LEXINGTON LOUNGE BE RENTED INDIVIDUALLY?', '<p>Absolutely! Our Soho Suite and Lexington Lounge are great spaces for birthday parties, corporate meetings, photo and video shoots, bridal showers, baby showers and workshops. Please inquire with The Astorian for pricing and availability.</p>', 146, 5, 148, NULL, 1, '2021-03-22 11:52:10', '2021-03-22 11:52:10'),
(57, 'DOES THE ASTORIAN HAVE RESTRICTIONS ON DECOR OR WEDDING EXITS?', '<p>&nbsp;</p>\r\n\r\n<p>To ensure our property stays in lovely condition for each of our clients, the Astorian does not allow glitter, confetti, balloon drops or open flame. Hanging any items from our chandeliers or ceiling and placing decals on our floor, walls, or ceiling is also strictly prohibited. Approved d&eacute;cor vendors, however, are allowed to hang greenery from our main venue ceiling fixtures. Please inquire with The Astorian on this request. For wedding exits, we allow sparklers (away from the building), bubbles and light-colored flower petals.</p>', 146, 5, 148, NULL, 1, '2021-03-22 11:52:32', '2021-03-22 11:52:32'),
(58, 'DOES THE ASTORIAN HAVE MULTIPLE EVENTS PER DAY?', '<p>The Astorian only hosts one event per day to ensure our clients have a successful event without feeling rushed!</p>', 146, 5, 148, NULL, 1, '2021-03-22 11:52:52', '2021-03-22 11:52:52'),
(60, 'How to add youtube video', '<p>You can use&nbsp;youtube&#39;s embed video URL to upload a video. e.g.&nbsp;&nbsp;https://www.youtube.com/embed/-68fbDNvbn4</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Steps to get the URL:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1. </strong>Open the video on the youtube.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2.</strong> Click on Share button as shown in the following screen-shot:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="https://www.eplame.com/dev/wedding_app/public/photos/1/download.png" style="width: 500px; height: 239px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3.</strong> Click on embed URL button and get the URL as shown in the following screen-shot:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="https://www.eplame.com/dev/wedding_app/public/photos/1/Screenshot.png" style="width: 500px; height: 217px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4.</strong> Use this link to embed the youtube videos in the business video gallery.</p>', NULL, NULL, 0, 'user', 1, '2021-04-19 07:22:36', '2021-04-20 10:13:15'),
(61, 'How to add videos', '<p>You can use&nbsp;youtube&#39;s embed video URL to upload a video. e.g.&nbsp;&nbsp;https://www.youtube.com/embed/-68fbDNvbn4</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Steps to get the URL:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1. </strong>Open the video on the youtube.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2.</strong> Click on Share button as shown in the following screen-shot:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="https://www.eplame.com/dev/wedding_app/public/photos/1/download.png" style="width: 500px; height: 239px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3.</strong> Click on embed URL button and get the URL as shown in the following screen-shot:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="https://www.eplame.com/dev/wedding_app/public/photos/1/Screenshot.png" style="width: 500px; height: 217px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4.</strong> Use this link to embed the youtube videos in the business video gallery.</p>', NULL, NULL, 0, 'vendor', 1, '2021-04-19 08:22:29', '2021-04-20 10:12:23'),
