(1110, 381, 382, 'Tune into her. Listen carefully to pick up clues of her latest interests and what type of date she needs. Every time you hear a clue write it down and you’ll have a running list of date ideas.', 'Tune into her. Listen carefully to pick up clues of her latest interests and what type of date she needs. Every time you hear a clue write it down and you’ll have a running list of date ideas.', '2020-08-27', 286, 28, 0, NULL, 0, '2020-08-27 07:45:03', '2020-08-27 07:45:03'),
(1111, 383, 384, 'Take initiative and ask her. Be creative. Perhaps leave her a note saying, “Would you go out with me on Friday? Yes, No, Maybe (Circle one and return to my night table)”', 'Take initiative and ask her. Be creative. Perhaps leave her a note saying, “Would you go out with me on Friday? Yes, No, Maybe (Circle one and return to my night table)”', '2020-08-27', 287, 28, 0, NULL, 0, '2020-08-27 07:45:03', '2020-08-27 07:45:03'),
(1112, 385, 386, 'Don’t leave this up to your wife. The day of the date, clean the house and have written instructions for the sitter. Do it all so she feels totally free of responsibility', 'Don’t leave this up to your wife. The day of the date, clean the house and have written instructions for the sitter. Do it all so she feels totally free of responsibility', '2020-08-27', 288, 28, 0, NULL, 0, '2020-08-27 07:45:03', '2020-08-27 07:45:03'),
(1113, 387, 388, 'Check availability and make reservations in advance. Make sure what you plan to do will be available and confirm the day before', 'Check availability and make reservations in advance. Make sure what you plan to do will be available and confirm the day before', '2020-08-27', 289, 28, 0, NULL, 0, '2020-08-27 07:45:03', '2020-08-27 07:45:03'),
(1114, 389, 390, 'Promote the date like a major event. Build anticipation so you both are excited.', 'Promote the date like a major event. Build anticipation so you both are excited.', '2020-08-27', 290, 28, 0, NULL, 0, '2020-08-27 07:45:03', '2020-08-27 07:45:03'),
(1115, 391, 392, 'Detail the car. Get a haircut and wear your best outfit. Shower, shave, put on the cologne she loves.', 'Detail the car. Get a haircut and wear your best outfit. Shower, shave, put on the cologne she loves.', '2020-08-27', 291, 28, 0, NULL, 0, '2020-08-27 07:45:04', '2020-08-27 07:45:04'),
(1116, 393, 394, 'Even though you may be in the same house, be ready early. But be patient because you may be waiting on her. Don’t make her feel rushed or pressured to get out the door. Let her know she is worth waiting for.', 'Even though you may be in the same house, be ready early. But be patient because you may be waiting on her. Don’t make her feel rushed or pressured to get out the door. Let her know she is worth waiting for.', '2020-08-27', 292, 28, 0, NULL, 0, '2020-08-27 07:45:04', '2020-08-27 07:45:04'),
