(9351, 381, 382, 'Tune into her. Listen carefully to pick up clues of her latest interests and what type of date she needs. Every time you hear a clue write it down and you’ll have a running list of date ideas.', 'Tune into her. Listen carefully to pick up clues of her latest interests and what type of date she needs. Every time you hear a clue write it down and you’ll have a running list of date ideas.', '2021-06-11', 1456, 180, 0, NULL, 0, '2021-06-10 09:57:38', '2021-06-10 09:57:38'),
(9352, 383, 384, 'Take initiative and ask her. Be creative. Perhaps leave her a note saying, “Would you go out with me on Friday? Yes, No, Maybe (Circle one and return to my night table)”', 'Take initiative and ask her. Be creative. Perhaps leave her a note saying, “Would you go out with me on Friday? Yes, No, Maybe (Circle one and return to my night table)”', '2021-06-11', 1457, 180, 0, NULL, 0, '2021-06-10 09:57:38', '2021-06-10 09:57:38'),
(9353, 385, 386, 'Don’t leave this up to your wife. The day of the date, clean the house and have written instructions for the sitter. Do it all so she feels totally free of responsibility', 'Don’t leave this up to your wife. The day of the date, clean the house and have written instructions for the sitter. Do it all so she feels totally free of responsibility', '2021-06-11', 1458, 180, 0, NULL, 0, '2021-06-10 09:57:38', '2021-06-10 09:57:38'),
