(56, 0, 0, 0, 'JBL FLIP 5', 'jbl-flip-5', 6, 'images/products/1644560624vtg7IREYxmCDFlbTs5uQdownload(5).jpeg', 12, 13, 21, 0, 118, 59, 59, '<h1>About this item</h1>\r\n\r\n<ul>\r\n	<li>JBL Signature Sound. Battery : Battery capacity (mAh) - 4,800. Charging time (hrs) 2.5</li>\r\n	<li>12 Hours playtime under optimal audio setting. Voice Assistant integration : No</li>\r\n	<li>IPX7 Waterproof allow you to enjoy music in rain or at your pool party</li>\r\n	<li>Dual external passive radiator and all new racetrack-shaped driver delivers hight output</li>\r\n	<li>PartyBoost allows you to pair two JBL PartyBoost-compatible speakers together for stereo sound or link multiple JBL PartyBoost-compatible speakers to pump up your party.</li>\r\n	<li>Tough as it sounds</li>\r\n	<li>What&rsquo;s in the box: 1 x JBL Flip 5, 1 x Type C USB cable, 1 x Safety Sheet, 1 x Quick Start Guide, 1 x Warranty Card</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>JBL SIGNATURE SOUND: Enjoy JBL Pure Bass Sound with all new race track drivers that pump booming Bass in a compact package</li>\r\n	<li>12 HOURS PLAYTIME: Keep the music going longer with 12 Hours of playtime under optimal audio settings</li>\r\n	<li>IPX7 WATERPROOF: IPX7 rated, the Flip 5 allows you to enjoy music in rain or at your pool party</li>\r\n	<li>PARTYBOOST: PartyBoost allows you to pair two JBL PartyBoost-compatible speakers together for stereo sound or link multiple JBL PartyBoost-compatible speakers to pump up your party</li>\r\n	<li>TOUGH AND RUGGED: Covered with Durable Fabric material along with Rubber housing, the Flip 5 is little gem for outdoors</li>\r\n	<li>WHATS IN THE BOX: 1 x JBL Flip 5, 1 x Type C USB cable, 1 x Safety Sheet, 1 x Quick Start Guide, 1 x Warranty Card</li>\r\n	<li>BATTERY CAPACITY:&nbsp;4000&nbsp;mAh | Charging Time: 2.5 Hrs</li>\r\n</ul>', 'PartyBoost allows you to pair two JBL PartyBoost-compatible speakers together for stereo sound or link multiple JBL PartyBoost-compatible speakers to pump up your party', 