(968, NULL, 'short_description', 'basic_information', 'Discreetly situated in a landmark building, as designated by The Houston Historical Society, The Astorian is an industrial chic, 14,000 square foot private loft space located in the Heights area of Houston. Conceived by Andria design to replicate New York City’s revered Grand Central Station, The Astorian is a throwback to 1920’s glamour and Art Deco design. The venue offers a contemporary, multi-level facility equipped with 14-foot ceilings, a fully functional gourmet kitchen and bar, and floor-to-ceiling windows with sweeping views of downtown Houston.', 146, 5, 148, '2021-03-22 10:43:34', '2021-03-22 11:33:04'),
