(1006, NULL, 'description', 'description', '<h3>HISTORY + SIGNIFICANCE&nbsp;</h3>\r\n\r\n<p>1940&nbsp;First constructed in the early 1900&rsquo;s, 2500 Summer Street was further developed in the 1940&rsquo;s when The Cook Paint and Varnish Company, one of the country&rsquo;s primary automobile paint suppliers, expanded into Texas. At its peak, Cook captured more than one-third of the nation&rsquo;s paint market.</p>\r\n\r\n<p>1995&nbsp;In 1995, the property was acquired by Houston-based artist, David Adickes, famous for his larger-than-life works, including a 67-foot tall statue of Sam Houston. While at 2500 Summer, Adickes also sculpted the busts of 43 American presidents, a 4-story tall sculpture of the Beatles, and the famous &ldquo;We Love Houston&rdquo; sign.</p>\r\n\r\n<p>2012&nbsp;Since 2012, the building has changed hands several times and in 2015, took on new life and importance as the home of one of Houston&rsquo;s elite event venues, The Astorian. In keeping with the building&rsquo;s rich artistic heritage, The Astorian has incorporated original pieces from the Cook Paint factory into the design, as well as one-of-a-kind creations by one of the building&rsquo;s original artists, Rafael Cueto. These include the hand-laid mosaic in the bar area flooring, the 12-foot, gold-plated clock and oxidized copper dome.</p>', 146, 5, 148, '2021-03-22 11:55:05', '2021-03-22 11:55:55'),
