(1016, NULL, 'detail', 'additional_information', '<p>&nbsp; Timeless elegance combined with white glove service and personalized details will create the social setting of a lifetime. The Astorian&rsquo;s attentive team will ensure that organizing and hosting your event is a seamless experience that not only enthralls your guests, but also leaves its mark as the talk of the town.</p>', 146, 5, 148, '2021-03-22 12:08:04', '2021-03-22 12:09:45'),
